const App = ()=>{

 const [inputList, setInputList] = useState("buy apple")

 const itemEvent = (event) =>{
   setInputList(event.target.value)
 };

 return(
   <> 
      <div className="main_div">
      <div className="center_div">
        <br />

       <h1> To Do List</h1>   
         <br />
         <input 
         type="text" 
         placeholder="Add An Items" 
         onChange={itemEvent}  
         />
         <button> + </button>

          <ol>
            <li> {inputList} </li>
          </ol>
      </div>
      </div>
   </>
   )
}

 export default App;
